import './App.css';
import { Router, Switch, Route, Redirect } from 'react-router-dom';

function App() {
  const PrivateRoute = ({ component: Component, ...rest }) => {
    <Route {...rest} render={(props) => isAuthenticated ? <Component {...props} /> : <Redirect to="/" />}></Route>
  }

  return (
    <div className="App">
      <Router>
        <Switch>
          <Route to="/" component={SignIn}></Route>
          <PrivateRoute to="/explore" component={ExploreJob}></PrivateRoute>
        </Switch>
      </Router>
    </div>
  );
}

export default App;
